import React from 'react'
import "../styles/Inventory.css";
import Item from "./InventoryItem";

let listProps=[<Item/>];

function Inventory() {
  return (
    <div className='inventory'>
      Inventory
      {listProps.map(item=>{<div className='item'>{item}</div>})}
    </div>
  )
}

export default Inventory
